import react from "react"

function LoginPage({ usernames }){

  function Love(){
    return(
      usernames.forEach(name => {
        <option>{name}</option>
      })
    )
  }

  return(
    <div className="loginForm">
      <form>
        <select>
          <option>1</option>
          <option>2</option>
        </select>
        <button>Login</button>
      </form>
    </div>
  )
}

export default LoginPage;
